import React from 'react'

const Kontakt = props => {

	// geiler Effekt:
	// backdropFilter: blur(10px) 
	
	const style = {
		section: {},
		heading: {
			margin:0,
    		padding: 10,
    		display: "inline-block",
    		background: 'rgb(240,240,240)',
    		color: 'rgb(120,120,120)',
    		position: 'initial',
    		zIndex: 4,
    		pointerEvents: 'none'
		},
		formularItem: {marginBottom:'2em',border:'1px solid rgb(200,200,200)',padding:20,textAlign:'center'},
		kontaktInput: {height:40,fontSize:'1.2em',textAlign:'center',padding:'20',width:'auto'}
	}

	const rootForBGChange = document.getElementById('root')
	rootForBGChange.style.background = 'rgb(240,240,240)'

	return (		
		<div className="sctn sctn_kontakt" style={style.section}>
			
			<div className="formular_item" id="kontaktart" style={style.formularItem}>
				<div className="sctn_subheading">
					<span className="sctn_heading delayed-fallable" style={style.heading}>Wie</span><span className="sctn_heading delayed-fallable" style={style.heading}>oder</span><span className="sctn_heading delayed-fallable" style={style.heading}>wo</span><span className="sctn_heading delayed-fallable" style={style.heading}>kann</span><span className="sctn_heading delayed-fallable" style={style.heading}>ich</span><span className="sctn_heading delayed-fallable" style={style.heading}>Sie</span><span className="sctn_heading delayed-fallable" style={style.heading}>kontaktieren?</span>
				</div>
				<input type="text" id="input_kontaktart" className="kontakt_input" style={style.kontaktInput}/>
			</div>

			<div className="formular_item" id="message" style={style.formularItem}>
				<div className="sctn_subheading">
					<span className="sctn_heading delayed-fallable" style={style.heading}>Eine</span><span className="sctn_heading delayed-fallable" style={style.heading}>Nachricht</span><span className="sctn_heading delayed-fallable" style={style.heading}>hinterlassen</span><span className="sctn_heading delayed-fallable" style={style.heading}>(optional):</span>
				</div>
				<input type="text" id="input_message" className="kontakt_input" style={style.kontaktInput}/>
			</div>

			<button type="submit">Absenden</button>

		</div>
	)
}

export default Kontakt
